.code
    main proc far
        mov AX,@DATA
        mov DS,AX
        mov ES,AX
        ;PUSHF
        
        ;;;;;;;;;;;;;;;;;;;;;;;;;;; first screen (Defining Usernames) 
        clear      
        start_screen   
                             
        ;;;;;;;;;;;;;;;;;;;;;;;;;;; second screen (Main Screen) 
        clear     
        main_screen
        
        MOV AL,level
        SUB AL,30h
        CMP AL,1
        JMP FIXX1
        IP1: 
        DrawInitialP1
        DrawInitialP2
        TAGET_1
        TAGET_2
        JMP CONT1
        FIXX1:
        JE CONT1
        JMP IP1
        CONT1:
        GO
        draw_bk 153,117,0,0,img1
	  
	               
	    DRAW_BK 56,176,0,117,IMG2
	     
	     
	    DRAW_bk 320,113,171,0,IMG3 
	    
	    
	    DRAW_BK 320,176,262,114,IMG4
        mov cl,1
        
        enterins:
        
        SelectProcessor
        CheckWinner1
        CheckWinner2
        CMP FE_PLAYER_KESEB,1
        JE RAND_END
        JMP CONTINUE_GAME
        RAND_END:
        JMP ENDGAME
        CONTINUE_GAME:
        DRAWREG_PLAYERS
        DrawTargetPoints
        DrawTargetPoints2
        mov_cursor 444ch
        readmsg instruction 
        checkEQUALITY pow1,instruction+2
        jmp Checkp2Jump 
        OkP1:
        detectPoints 5
        INPUTFIELD 444ch
        resetins instruction+2
        readmsg instruction 
        xor player,1
        CALL executeInstruction 
        xor player,1
        
        jmp ENDCHECKS      
        
        Checkp2Jump:
        jnz CheckP2
        jmp OkP1
         

        CheckP2:
        checkEQUALITY pow2,instruction+2
        jmp Checkp3Jump
        OkP2:
        detectPoints 3  
        INPUTFIELD 444ch
        resetins instruction+2
        readmsg instruction 
        CALL executeInstruction 
        xor player,1  
        CALL executeInstruction
        xor player,1
        
        jmp ENDCHECKS
        
        Checkp3Jump:
        jnz CheckP3
        jmp OkP2 

        CheckP3:
        checkEQUALITY pow3,instruction+2
        jmp CheckForP4
        YesPower3:
        Is_limitedP3
        detectPoints 8
        MOV CL,player
        CMP CL,0
        jmp TestFlTest
        Yesp1:
        MOV CL,1
        MOV FL_changed2,CL
        FL_screen2
        GO
        
        jmp ENDCHECKS 
        TestFlTest:
        je ch0
        jmp Yesp1 
        ch0:            
        MOV CL,1
        MOV FL_changed1,CL
        FL_screen
        GO 
                 
        jmp ENDCHECKS
        
        CheckForP4:
        jnz CheckP4
        jmp YesPower3
        
        
        CheckP4:
        checkEQUALITY pow4,instruction+2
        jmp LawP5
        ya3amP4:
        detectPoints 2 
        mov IS_P4,0
        INPUTFIELD 494ch
        jmp ENDCHECKS
         
        LawP5: 
        jnz CheckP5
        jmp ya3amP4
         
        CheckP5:
        checkEQUALITY pow5,instruction+2
        jmp lawnormal
        ya3amP5:  
        Is_limitedP5
        detectPoints 30  
        mov al,0
        mov cx,28
        MOV DI,offset ALREG
        REP STOSB 
        INPUTFIELD 494ch
        jmp ENDCHECKS
        lawnormal:
        jnz NORMALEXE  
        jmp ya3amP5 
         
        NORMALEXE: 
        CALL executeInstruction
        ;--check for p4
        cmp IS_P4,0
        jnz ENDCHECKS
        mov bx,OFFSET_P4
        mov ax,[bx]
        and ax,0FFFEH
        mov [bx],ax 
        ;mov_cursor 374ch
        ;printhexa AX
        mov IS_P4,1 
        
        
        ENDCHECKS:
        resetins instruction+2 
        xor player,1
        ;---------------------------------------
             MOV AH, 00h  ; interrupts to get system time        
   INT 1AH      ; CX:DX now hold number of clock ticks since midnight      
                ; lets just take the lower bits of DL for a start..
   MOV BH, 57   ; set limit to 57 (ASCII for 9) 
   MOV AH, DL  
   CMP AH, BH   ; compare with value in  DL,      
   JA RANDOM ; if more, regenerate. if not, continue... 

   MOV BH, 30  ; set limit to 48 (ASCII FOR 0)
   MOV AH, DL   
   CMP AH, BH   ; compare with value in DL
   JB RANDOM ; if less, regenerate.   
        
         JMP  CHECK_TIME
        RANDOM:
         JMP enterins
     ;-------------------------------------------------------------
          CLEAR_SCREEN
        ; get the system time 
       CHECK_TIME: 
       
       
                 
        MOV AH,2Ch
       INT 21h
        
        CMP DL,TIME_AUX  
        JE  CHECK_TIME
        
        MOV TIME_AUX,DL     ;UPDATE TIME
        
        
            ; CLEAR_SCREEN
             
