              ; printnum2 yellow_color2
               
                ;printnum2 red_color2
                 ;printnum2 blue_color2
                  ;printnum2 PLAYER_TWO_POINTS          
                         
                      ;;;;;;;;;;;;;
                           
             cmp turn,5
             jl first 
                jmp exit
               first:
               
                           
          Move_Target  Target_x, Target_y,WINDOW_WIDTH2,Target1_start_x  
           Draw_Target  Target_x, Target_y   
            
          
             
            MOVE_PADDLES           ;move the two paddles 
                Draw_paddles
         
                
            
            
			  CMP GUN,0            ;; if fire or not
		    JE fire_f
		  
		   jmp not_fire_loop_f 
		   
		   
		   
		       
